package com.rrgame.sdk.adutils;

import com.rrgame.sdk.systeminfo.AderBase64;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;

public class AderImages {
	
	// “点击下载图片 base64以后的字符串"
	private static final String clickImageChars = "";
	private static Bitmap clickImage = null;

	// 返回“点击下载图片”Bitmap
	public static Bitmap clickImage() {
		if (clickImage == null) {
			try {
				byte[] bitmapArray;
				bitmapArray = AderBase64.decode(clickImageChars);
				clickImage = BitmapFactory.decodeByteArray(bitmapArray, 0,
						bitmapArray.length);
			} catch (Exception e) {
				e.printStackTrace();
			}

		}
		return clickImage;
	}

}
